    <div className={style.container}>
      <p className={style.p}>Your shopping cart is empty</p>
      <img
        className={style.img}
        src="https://i.ibb.co/0j3QYQV/empty-cart.png"
        alt="empty-cart"
        border="0"
      />
      <p>Continue shopping on the </p>
    </div>
  );
};
